import Vue from 'vue'
import Vuex from 'vuex'

Vue.use(Vuex)

import allProducts from './allProducts/index.js'
import allOwner from './AllOwner/index'
import discussion from './d'



export default new Vuex.Store({

  modules: {
    allProducts,
    allOwner
  }
})
